const Posts = (props) => {
  console.log(props.postsData)
  return (
    <div>
      Posts
    </div>
  )
}

Posts.getInitialProps = async function(){
  const res = await fetch('http://localhost:3000/api/posts')
  const postsData = await res.json()
  console.log(postsData)
  return {
    postsData
  }

}


export default Posts
